import React, { useState } from 'react'
import { NavLink } from 'react-router-dom'

function Navbar() {
  let [isClicked,setIsClicked]=useState(false)
  return (
    <>
    <div className='nav-comp'>
    <NavLink to= '/' className={({isClicked}) => {
      return ('clicked' + (isClicked?'clicked':'not-clicked'))
    }}>Home</NavLink>
    <NavLink to='/About' className={({isClicked}) => {
      return ('clicked' + (isClicked?'clicked':'not-clicked'))}}>About Us</NavLink>
    <NavLink to='/SignIn' className={isClicked?'clicked':'not-clicked'} onClick={()=> {setIsClicked(true)}} >Sign In</NavLink>
    <NavLink to='/SignUp' className={isClicked?'clicked':'not-clicked'} onClick={()=> {setIsClicked(true)}}>Sign Up</NavLink>
    </div>
    </>
    )
}

export default Navbar
